import React, { useState } from 'react';
import SearchBar from './components/SearchBar';
import MovieList from './components/MovieList';
import NominationList from './components/NominationList';

import DialogTitle from '@material-ui/core/DialogTitle';
import Dialog from '@material-ui/core/Dialog';

import omdb from './api/omdb';

const App = () => {

    const [movies, setMovies] = useState([]);

    const [nominations, setNominations] = useState([]);

    const [searchError, setSearchError] = useState('');

    const onTermSubmit = async (term) => {
        // HTTP request to OMDB API
        const response = await omdb.get(
            '',
            {
                params: {
                    s: term,
                    type: 'movie'
                }
            }
        );
        console.log("Search response:");
        console.log(response);

        if (response.data.Response === "False") {
            setSearchError(response.data.Error);
        } else {
            setSearchError('');
            setMovies(response.data.Search);
        }
    };

    const onNominate = (movie) => {
        setNominations(oldNominations => [...oldNominations, movie]);
    };

    const onRemoveNomination = (movie) => {
        const newList = nominations.filter((movieItem) => movieItem !== movie);
        setNominations(newList);

    };

    return (
        <div>
            <div>Shoppies</div>
            <SearchBar onTermSubmit={onTermSubmit} />
            <NominationList nominations={nominations} onRemoveNomination={onRemoveNomination} />
            <div>XXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXXX</div>
            <MovieList movies={movies} onNominate={onNominate} nominations={nominations} searchError={searchError} />
            <div className={classes.root}>
                <Accordion expanded={expanded === 'panel1'} onChange={handleChange('panel1')}>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel1bh-content"
                        id="panel1bh-header"
                    >
                        <Typography className={classes.heading}>General settings</Typography>
                        <Typography className={classes.secondaryHeading}>I am an accordion</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                            Nulla facilisi. Phasellus sollicitudin nulla et quam mattis feugiat. Aliquam eget
                            maximus est, id dignissim quam.
          </Typography>
                    </AccordionDetails>
                </Accordion>
                <Accordion expanded={expanded === 'panel2'} onChange={handleChange('panel2')}>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel2bh-content"
                        id="panel2bh-header"
                    >
                        <Typography className={classes.heading}>Users</Typography>
                        <Typography className={classes.secondaryHeading}>
                            You are currently not an owner
          </Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                            Donec placerat, lectus sed mattis semper, neque lectus feugiat lectus, varius pulvinar
                            diam eros in elit. Pellentesque convallis laoreet laoreet.
          </Typography>
                    </AccordionDetails>
                </Accordion>
                <Accordion expanded={expanded === 'panel3'} onChange={handleChange('panel3')}>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel3bh-content"
                        id="panel3bh-header"
                    >
                        <Typography className={classes.heading}>Advanced settings</Typography>
                        <Typography className={classes.secondaryHeading}>
                            Filtering has been entirely disabled for whole web server
          </Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                            Nunc vitae orci ultricies, auctor nunc in, volutpat nisl. Integer sit amet egestas eros,
                            vitae egestas augue. Duis vel est augue.
          </Typography>
                    </AccordionDetails>
                </Accordion>
                <Accordion expanded={expanded === 'panel4'} onChange={handleChange('panel4')}>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel4bh-content"
                        id="panel4bh-header"
                    >
                        <Typography className={classes.heading}>Personal data</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                            Nunc vitae orci ultricies, auctor nunc in, volutpat nisl. Integer sit amet egestas eros,
                            vitae egestas augue. Duis vel est augue.
          </Typography>
                    </AccordionDetails>
                </Accordion>
            </div>


        </div>
    );
};


export default App;
